import { Component } from "react";
import axios from '../conexion';
var qs = require('qs');

/*const */

class Ingreso extends Component{  
    constructor(props){
        super(props);
        this.state={
            click: false
        }
    }

    ingresar =async (email,pass)=>{
        console.log(email+pass)
        var data = qs.stringify({
            'UsEmail': email,
            'UsPass': pass 
          });

          var config = {
            method: 'post',
            url: 'http://localhost:3200/api/user/login',
            headers: { 
              'Content-Type': 'application/x-www-form-urlencoded'
            },
            data : data
          };
        const usuario= await axios(config);
        console.log(usuario)
    }
    
    render(){
        return(
            <div>
                <form>
                    Email: <input type='email' className="element" id='email' ></input><br/>
                    pass: <input type='password' className="element" id='pass' ></input><br/>
                </form>
                <button className="element" onClick={()=>{this.setState({click: true}); this.ingresar(document.getElementById('email'),document.getElementById('pass'))}}>Ingresar</button>
            </div>
        )
    }

    
}

export default Ingreso;
